ser = serial.Serial('/dev/ttyACM0',115200, timeout=1)
breakSerial = False
cursorImage = Image.open('cursor.jpg')
cursorImage = cursorImage.resize((20, 20), Image.ANTIALIAS)

def serialSendThread():
    global ser, breakSerial, cursorImage
    if ser.is_open:
        with mss() as sct:
            monitor_number = 0
            mon = sct.monitors[monitor_number]
            monitor = {
                "top": mon["top"] + 410,  # 100px from the top
                "left": mon["left"] + 460,  # 100px from the left
                "width": 640,
                "height": 380,
                "mon": monitor_number,
            }
            while not breakSerial:
            # for i in range(1):
                sct_img = sct.grab(monitor)
                mousex, mousey = pyautogui.position()
                # print(mousex,mousey)
                mousex, mousey = mousex-460, mousey-410
                imgpill = Image.frombytes("RGB", sct_img.size, sct_img.bgra, "raw", "BGRX")
                if ((mousex+20) <= 640) and ((mousey+20) <= 380 and mousex >=0 and mousey >= 0):
                    imgpill.paste(cursorImage, box=(mousex,mousey,mousex+20,mousey+20))
                # imgpill.show()
                imgpill = imgpill.resize((128, 128), Image.ANTIALIAS)
                imgcvt = imgpill.convert('P')
                pallet = imgcvt.getpalette()
                image = imgcvt.tobytes()
                pallet = bytearray(pallet)
                ser.write(b'STARTI')
                time.sleep(0.2)
                ser.write(image)
                time.sleep(0.5)
                ser.write(b'STARTP')
                time.sleep(0.2)
                ser.write(pallet)
                time.sleep(0.5)
    print("finish send thread")


def serialReceiveThread():
    global ser, breakSerial
    xydata = [0,0]
    xybias = [7251, 8295]
    speed = 10
    if ser.is_open:
        while not breakSerial:
            datareceive = ser.read_until()
            if datareceive:
                try:
                    code = datareceive.decode("utf-8")
                    if code == "JOY_BUTTON_CLICK\n":
                        print(code)
                        pyautogui.click()
                    elif code == "ZOOM\n":
                        print(code)
                        pyautogui.mouseDown()
                        time.sleep(.5)
                        pyautogui.mouseUp()
                    elif code == "IMAGE_RECEIVED\n":
                        print(code)
                    elif code == "PALLET_RECEIVED\n":
                        print(code)
                    else:
                        data = ''
                        n = len(code)
                        for i in range(n):
                            if code[n-i-2]=='X':
                                data = int(data[len(data)::-1])
                                xydata[0] = data
                                break
                            elif code[n-i-2]=='Y':
                                data = int(data[len(data)::-1])
                                xydata[1] = data
                                dx = xydata[0] - xybias[0]
                                dy = -(xydata[1] - xybias[1])
                                if abs(dx) > 500 or abs(dy) > 500:
                                    theta = atan2(dy,dx)
                                    print(theta)
                                    dx = speed*cos(theta)
                                    dy = speed*sin(theta)
                                    mousex, mousey = pyautogui.position()
                                    mousex, mousey = mousex + dx, mousey + dy
                                    if pyautogui.onScreen(mousex, mousey):
                                        pyautogui.moveTo(mousex, mousey)
                                print(xydata)
                                break
                            else:
                                data += code[n-i-2]
                except Exception as e:
                    print("error: "+str(e))
    print("finish revceive thread")


if __name__ == "__main__":
    threading.Thread(target=serialSendThread).start()
    threading.Thread(target=serialReceiveThread).start()

    while True:
        option = input("input \"q\" for quite:\n")
        if option == 'q':
            breakSerial = True
            time.sleep(3)
            break
    ser.close()
